tables.table_schema:
CREATE TABLE nanoparticle_properties (
  nanoparticle_id INT PRIMARY KEY,
  nanoparticle_name VARCHAR(255),
  nanoparticle_size FLOAT,
  nanoparticle_surface_charge VARCHAR(255)
);

CREATE TABLE cell_lines (
  cell_line_id INT PRIMARY KEY,
  cell_line_name VARCHAR(255),
  cell_line_type VARCHAR(255),
  passage_number INT
);

CREATE TABLE experiments (
    experiment_id UUID PRIMARY KEY,
    experiment_date DATE NOT NULL,
    particle_size FLOAT NOT NULL,
    cell_type VARCHAR(50) NOT NULL
);

CREATE TABLE participants (
    participant_id UUID PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    age INT NOT NULL,
    gender VARCHAR(10)
);

CREATE TABLE analysis (
    analysis_id UUID PRIMARY KEY,
    result_id UUID REFERENCES results(result_id),
    analysis_date DATE NOT NULL,
    findings TEXT
);

CREATE TABLE nanoparticle (
    nanoparticle_id INT PRIMARY KEY,
    nanoparticle_name VARCHAR(255),
    nanoparticle_size FLOAT,
    nanoparticle_material VARCHAR(255)
);

CREATE TABLE cell_types (
    cell_type_id INT PRIMARY KEY,
    cell_type_name VARCHAR(255)
);

CREATE TABLE researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(255),
    researcher_email VARCHAR(255)
);

CREATE TABLE experimental_conditions (
    condition_id INT PRIMARY KEY,
    experiment_id INT,
    condition_description TEXT,
    condition_temperature FLOAT
);
